        "IT": "マーヴィカ",
        "Tab": "UI_LegendQuestImg_Mavuika",
        "Icon": "UI_ChapterIcon_Mavuika",
        "Intro": "アビスの危機が去り、ナタは長く待ち望んでいた平和を迎えた。人々の生活もそれに伴って変化していく…<br>しかし、まだ時は来ていない。大切なものを守る力を捨てず、懸命に戦った日々を忘れないようにしよう。<br>太陽が昇る限り、戦いはなくならない。<br>戦士たちは苦難を乗り越え、過去と未来へのために戦う。"
